import React, { useState } from "react";
// import Cards from "./Cards";
import "./App.css";
// import Sdata from "./Sdata";

function App() {
  const state = useState();

  console.log(state);

  let [count, setCount] = useState(0);

  const IncNum = () => {
    setCount(useState);
    console.log("clicked " + count++);
    count++;
  };
  return (
    <>
      <h1>{count}</h1>
      <button onClick={IncNum}>Click Me!</button>
    </>
  );
}

export default App;
